import Editor from "./Editor";
import {Box,styled} from"@mui/material";

const CodeBox = styled(Box)`
    display : flex
`

const Code = () => {
    return(
        <CodeBox>
            <Editor 
                heading = "HTML"
                icon = "/"
                color= ''
            />
            <Editor 
                heading = "CSS"
                icon = "@"
            />
            <Editor 
                heading = "JS"
                icon = "{}"
            />
        </CodeBox>
    );
}

export default Code;
